import * as React from 'react';
import { AddressProperties } from "./type";
import {AgGridColumn, AgGridReact} from 'ag-grid-react';
import { gridSettings } from "./Style/dataGrid";

import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';

interface TxRowsI {
    Id: number;
    Hash: string;
    Block: number;
    Date: number;
    Value: number;
}

function fillData ({txs, arraySize}: AddressProperties) {
    const TxArray: Array<TxRowsI> = txs.map((t, index) => ({
        Id: index,
        Hash: t.hash,
        Block: t.block_height,
        Date: t.time,
        Value: t.balance
    }));
    console.log(TxArray);
    return TxArray.slice(0, arraySize);
}

export const DisplayData = ({addresses, info ,txs, wallet, arraySize}: AddressProperties) => {
    console.log(arraySize);

    const rowData: any = fillData({addresses, info, txs, wallet, arraySize});

    return (
        <div id="ez" className="ag-theme-alpine" style={gridSettings}>
            <AgGridReact
                rowData={rowData}>
                <AgGridColumn field="Id"></AgGridColumn>
                <AgGridColumn field="Hash"></AgGridColumn>
                <AgGridColumn field="Block"></AgGridColumn>
                <AgGridColumn field="Date"></AgGridColumn>
                <AgGridColumn field="Value"></AgGridColumn>
            </AgGridReact>
        </div>
    );
};
